Le président de la République fédérative du Brésil est le chef de l'État brésilien depuis 1891.
Le titre de la fonction a varié au gré de l'évolution de la forme longue de l'État dans la Constitution :

1889-1891 : président de la République du Brésil ;
1891-1967 : président de la République des États-Unis du Brésil ;
depuis 1967 : président de la République fédérative du Brésil.

Echelon est un nom de code utilisé pendant de nombreuses années par les services de renseignements des États-Unis pour désigner une base d'interception des satellites de télécommunications commerciaux. Par extension, le réseau Echelon désigne le système mondial d'interception des communications privées et publiques (SIGINT), élaboré par les États-Unis, le Royaume-Uni, le Canada, l’Australie et la Nouvelle-Zélande dans le cadre du traité UKUSA.
Le réseau Echelon est géré conjointement par les services de renseignements des États membres du UKUSA :

la NSA (National Security Agency) pour les États-Unis qui en est le principal contributeur et utilisateur ;
le GCHQ (Government Communications Headquarters) pour le Royaume-Uni ;
le CSTC (Centre de la sécurité des télécommunications Canada) pour le Canada ;
l'ASD (Australian Signals Directorate) pour l'Australie ;
le GCSB (Government Communications Security Bureau) pour la Nouvelle-Zélande.C’est un réseau global, appuyé par des satellites artificiels, de vastes bases d’écoutes situées aux États-Unis, au Canada (à Leitrim), au Royaume-Uni (à Morwenstow (en)), en Australie (à Pine Gap) et en Nouvelle-Zélande (à Waihopai), des petites stations d'interception dans les ambassades, et le sous-marin USS Jimmy Carter (SSN-23) de la classe Seawolf, entré en service en 2005 pour écouter les câbles sous-marins de télécommunications.
Il intercepte les télécopies, les communications téléphoniques, les courriels et, grâce à un puissant réseau d’ordinateurs, est capable de trier en fonction de certains termes les communications écrites et, à partir de l’intonation de la voix, les communications orales.
Bien que plusieurs autres pays aient mis en place des systèmes similaires, comme Frenchelon en France, il reste aujourd’hui le plus puissant au monde.
Ces réseaux peuvent être utilisés pour des actions militaires ou politiques.
2 000 personnes, dont 1 500 Américains, travaillent sur la base du Yorkshire au Royaume-Uni, la plus grosse hors des États-Unis.
Toutes les informations récoltées par le réseau Echelon sont analysées au quartier général de la NSA à Fort George G. Meade (Maryland, États-Unis).

En mathématiques, le raisonnement par récurrence (ou  par induction, ou induction complète) est une forme de raisonnement visant à démontrer une propriété portant sur tous les entiers naturels. Le raisonnement par récurrence consiste à démontrer les points suivants :

la propriété est satisfaite par l'entier 0 ;
chaque fois que cette propriété est satisfaite par un certain nombre entier naturel n, elle est également satisfaite par son successeur, c'est-à-dire par le nombre entier n + 1.Une fois cela établi, on en conclut que cette propriété est vraie pour tous les nombres entiers naturels.

En informatique et en science de l'information, une ontologie est l'ensemble structuré des termes et concepts représentant le sens d’un champ d'informations, que ce soit par les métadonnées d'un espace de noms, ou les éléments d'un domaine de connaissances. L'ontologie constitue en soi un modèle de données représentatif d'un ensemble de concepts dans un domaine, ainsi que des relations entre ces concepts. Elle est employée pour raisonner à propos des objets du domaine concerné. Plus simplement, on peut aussi dire que l’« ontologie est aux données ce que la grammaire est au langage ».
Le terme est utilisé par analogie avec le concept philosophique, d'ontologie (de onto-, tiré du grec ὤν, ὄντος « étant », participe présent du verbe εἰμί « être ») qui est l'étude de l'être en tant qu'être, c'est-à-dire l'étude des propriétés générales de ce qui existe.
Les concepts sont organisés dans un graphe dont les relations peuvent être :

des relations sémantiques ;
des relations de subsomption.L'objectif premier d'une ontologie est de modéliser un ensemble de connaissances dans un domaine donné, qui peut être réel ou imaginaire.
Les ontologies sont employées dans l’intelligence artificielle, le Web sémantique, le génie logiciel, l'informatique biomédicale ou encore l'architecture de l'information comme une forme de représentation de la connaissance au sujet d'un monde ou d'une certaine partie de ce monde. Les ontologies décrivent généralement :

individus : les objets de base ;
classes : ensembles, collections, ou types d'objets ;
attributs : propriétés, fonctionnalités, caractéristiques ou paramètres que les objets peuvent posséder et partager ;
relations : les liens que les objets peuvent avoir entre eux ;
événements : changements subis par des attributs ou des relations ;
métaclasse (web sémantique) : des collections de classes qui partagent certaines caractéristiques.

Si la Russie n'est plus une des premières puissances économiques mondiales comme au temps de l'Union soviétique, elle demeure aujourd'hui une des 10 économies les plus importantes au niveau international (en 2014, 10° rang), avec des ressources naturelles inégalées, une population de plus de 140 millions d'habitants, des compétences scientifiques et techniques parmi les plus avancées au monde, et une croissance économique forte depuis l'année 1999.
Par son économie, la Russie se distingue par quatre caractéristiques majeures :

L'économie russe est une économie de transition ou du moins dont la transition s'achève, et qui reste encore marquée par son héritage soviétique ;
Elle tend vers l'économie de rente, s'étant majoritairement repliée sur l'exploitation de ses ressources naturelles (pétrole, gaz naturel et divers métaux) à la suite de l'effondrement de la production industrielle depuis la chute de l'URSS. Ceci avec les conséquences politiques et sociales qu'engendrent en général la prédominance de ces secteurs (corruption, inégalités) ;
C'est une économie qui souffre du vieillissement démographique , du fait de déséquilibres démographiques apparus dès la fin de l'époque soviétique ;
C'est enfin une économie où l'État a joué et joue toujours un rôle majeur - qu'il s'agisse du contrôle des principales entreprises du pays ou de la place préoccupante de la corruption (La Russie se place en 154e position, sur 178 territoires, sur la liste de la perception de la corruption par pays en 2010).

L’École centrale de Lille (Centrale Lille, EC-Lille) est l'une des cinq plus anciennes écoles d'ingénieurs de France dont les anciens élèves sont cofondateurs de la fédération des associations et sociétés françaises d'ingénieurs diplômés, parmi les 205 écoles d'ingénieurs françaises accréditées au 1er septembre 2018 à délivrer un diplôme d'ingénieur.
Établie en 1872 sous la dénomination institut industriel du Nord (IDN), héritière de l'école des arts industriels et des mines de Lille fondée en 1854, c'est une école généraliste couvrant l'ensemble du spectre des sciences pour l'ingénieur. Elle est membre du groupe Centrale. 
L’École centrale de Lille est située sur le campus Cité Scientifique de l'Université de Lille à Villeneuve-d’Ascq (Métropole européenne de Lille, Hauts-de-France) et est membre fondateur de la COMUE Lille Nord de France.
L’école assure les formations suivantes :

diplôme d'ingénieur Centrale Lille (master) ;
masters recherches francophones et masters anglophones ;
doctorat dans six spécialités des sciences pour l'ingénieur ;
diplômes d'ingénieur spécialiste, mastères spécialisés (MS) ;
doubles-diplômes ingénieur et masters scientifiques, architecture, gestion, finance, entrepreneuriat.En incluant toutes les formations ainsi que les doctorants, l’École centrale de Lille compte en 2018 plus de 1 500 étudiants.
Ce site est desservi par la station de métro Quatre Cantons - Stade Pierre-Mauroy :

à 15 min de la gare de Lille Europe (TGV-Paris 58 min ; TGV-Bruxelles 35 min ; Eurostar-Londres 80 min) ;
à 8 km de l'aéroport de Lille - Lesquin ;
à 800 m du Stade Pierre-Mauroy.

La loi no  94-665 du 4 août 1994 relative à l'emploi de la langue française, plus connue sous le nom de loi Toubon du nom de Jacques Toubon, le ministre de la Culture de l'époque, est une loi française destinée à protéger le patrimoine linguistique français.
Elle vise trois objectifs principaux :

l'enrichissement de la langue ;
l'obligation d'utiliser la langue française ;
la défense du français en tant que langue de la République (article 2 de la Constitution de 1958).Elle vise alors à assurer la primauté de l'usage de termes francophones traditionnels face aux anglicismes.

La surface agricole utile (SAU) est un instrument statistique destiné à évaluer la surface foncière déclarée par les exploitants agricoles comme utilisée par eux pour la production agricole, différente de la SAT (surface agricole totale).
La SAU est composée des :

terres arables (grandes cultures, cultures maraîchères, cultures permanentes, les cultures fourragères, prairies artificielles...) ;
surfaces toujours en herbe (prairies permanentes, alpages) ;
cultures pérennes (vignobles, vergers...)
les jardins familiaux des agriculteurs.Elle n'inclut pas les bois et forêts. Elle comprend en revanche les surfaces en jachère, c’est-à-dire les terres retirées de la production (gel des terres). Ces terres sont comprises dans les terres arables.

La dystrophie musculaire des ceintures englobe un groupe de maladies neuromusculaires qui affectent essentiellement les muscles volontaires situés autour de la région scapulaire (épaules) et de la région pelvienne (les hanches).
Les différentes dystrophies musculaires se différencient en fonction :

de l'âge de survenue ;
des manifestations cliniques pouvant atteindre le cœur ;
de critères génétiques ;
des modes de transmission.La classification actuelle est basée sur l'analyse génétique et des protéines en cause.

En médecine, l'insuffisance respiratoire désigne l'incapacité de l'appareil respiratoire à assumer correctement sa fonction, à savoir l’hématose. Elle peut être « aiguë » (survenue rapide) ou « chronique » (apparition et évolution lentes).
Elle peut être liée à des phénomènes

obstructifs (corps étranger entravant le passage de l'air) comme l'asthme, la mucovicidose, la bronchite chronique ;
restrictifs (phénomènes diminuant le volume maximal de la cage thoracique) tels qu'une scoliose ou une pathologie neuro-musculaire : on parle alors d'Insuffisance respiratoire chronique restrictive ;
traumatiques : fausse route, pneumothorax, hémothorax.Les symptômes dépendent du caractère aigu ou chronique.
En fonction de la gravité, l'insuffisance respiratoire aigüe se manifeste par :

une limitation des capacités physiques ;
une difficulté lors de la prise des repas et une somnolence postprandiale (après le repas) ;
un encombrement des voies respiratoires et des bronchites chroniques ;
des troubles de la vigilance et de l'humeur ;
des insomnies ;
des sueurs ;
des céphalées (maux de tête) ;
de la tachycardie (accélération du rythme cardiaque) ;
une cyanose (coloration bleue des doigts et des lèvres).

