le minerai de fer en Lorraine (minette lorraine) ;
un petit projecteur d'appoint pour la vidéo ;
une ancienne unité de mesure, en relation avec la mine ;
une variété de rose ancienne, 'Minette', obtenue en 1819.

Robert Bosch GmbH est une multinationale allemande fondée par Robert Bosch en 1886. Ses principaux centres d'activités sont :

équipementier pour l'industrie automobile ;
fabricant d'outils électriques et d'appareils électroménager ;
