Un essai de traction est une expérience de physique qui permet de :

déterminer le comportement élastique d'un matériau ;
mesurer le degré de résistance à la rupture d'un matériau ;et ce dans un état de contrainte uniaxiale.
Certains objets manufacturés doivent avoir un minimum de solidité pour pouvoir supporter les charges, le poids et bien d'autres efforts. L'essai de traction permet de caractériser les matériaux, indépendamment de la forme de l'objet sollicité, ou la performance d'un assemblage mécanique. Comme tout essai mécanique, l'essai de traction reproduit une sollicitation simple, donc éloignée des sollicitations réelles, mais facilement maîtrisable et reproductible.
Cet essai ou expérience consiste à placer une petite barre du matériau à étudier entre les mâchoires d'une machine de traction qui tire sur la barre jusqu'à sa rupture. On enregistre l'allongement et la force appliquée, que l'on convertit ensuite en déformation et contrainte. Une variante moderne des essais de traction consiste à utiliser la force centrifuge sur un assemblage pour générer une contrainte de traction. Lorsque la valeur limite de résistance à la traction (exprimée en MPa ou N) d'un assemblage ou d'un collage est égale à la force centrifuge appliquée, on génère la rupture de ceux-ci et enregistre la limite de rupture. L'avantage consiste à réaliser des tests en batterie sur plusieurs éprouvettes soumises à une contrainte strictement identique lors de l'essai.
L'essai de traction donne plusieurs valeurs importantes :

le module de Young, E, ou module d'élasticité longitudinale, exprimé en mégapascals (MPa) ou en gigapascals (GPa) ;
la limite d'élasticité (lorsqu'elle existe), Re, σe, σy ou fy (yield stress), qui sert à caractériser un domaine conventionnel de réversibilité ;
la résistance à la traction Rm, σm ou fu (limite ultime), qui définit la limite à la rupture ;
l'allongement à la rupture A%, qui mesure la capacité d'un matériau à s'allonger sous charge avant sa rupture, propriété intéressante dans certaines applications ;
le coefficient de Poisson ν, qui correspond à la proportion entre la déformation transversale (diminution de section) et la déformation longitudinale (allongement relatif) de la pièce dans le domaine élastique.

Cette page présente les principaux membres de la famille Disney à l'exception de :

Walt Disney ;
