Le terme face ou babyface (beau en français) au catch désigne le « gentil », celui qu'on destine à être apprécié par la foule et à en recevoir l'approbation. C'est l'opposé du heel, le « méchant ». L'objectif in fine de la chose est double : 

concentrer l'acclamation, la réaction du public face à l'action en cours, sur un des deux lutteurs — en l'occurrence le face, afin de l'amplifier ;
offrir un exutoire au public présent en lui permettant, au travers des personnages et de la scénarisation de l'enjeu en cours, d'évacuer sa frustration du quotidien.

L’Empire allemand (en allemand : Deutsches Reich) était le premier État-nation de l’histoire de l’Allemagne. Deutsches Reich a été le nom légal de cet État de janvier 1871 à juin 1945. Juridiquement issu de la confédération de l'Allemagne du Nord créée en 1867, il rassemblait la plupart des États précédemment membres de la Confédération germanique à l’exclusion de l’Autriche dans le cadre de la configuration dite « petite-allemande ». Son territoire a subi d’importantes pertes après la Première Guerre mondiale ; il a ensuite été étendu à l’Autriche et à d’autres régions frontalières à la suite des annexions et conquêtes du régime nazi, et la désignation officielle de l’État a été changée en Reich grand-allemand (en allemand : Großdeutsches Reich) en 1943. Il s’est effondré de facto, sinon de jure, avec la défaite de 1945 face aux Alliés.
Trois régimes politiques, distingués par leurs noms d'usage, ont utilisé ce nom officiel :

l’Empire allemand (1871-1918), parfois appelé le « Deuxième Reich » ou « Reich impérial », une monarchie constitutionnelle à tendance autoritaire dominée par la Prusse et où les anciennes dynasties coexistaient avec le pouvoir de l’empereur ;
la république de Weimar (1919-1933), parfois appelée la « Première République » ou « Reich républicain » , une république pluraliste et semi-présidentielle plus centralisée ;
le Troisième Reich (1933-1945), le régime nazi dirigé par Adolf Hitler, celui-ci s’étant attribué en août 1934 le titre de « Führer et chancelier du Reich » (en allemand : Führer und Reichskanzler), fusionnant à son profit les postes de chancelier et de président du Reich.Le terme Reich, intraduisible précisément en français, fait référence au Saint-Empire romain de la Nation germanique (en allemand : Heiliges Römisches Reich Deutscher Nation), vaste ensemble qui rassembla de 962 à 1806 de nombreux États sous la couronne d’un « empereur des Romains ». L’Empire allemand de 1871-1918 utilisa à son profit l'appellation complémentaire « Deuxième Reich », souhaitant ainsi se placer dans la continuité du Saint-Empire (le « Premier Reich ») ; ensuite, le régime nazi ne fit que suivre la même logique en utilisant le nom « Troisième Reich ».

Dans le domaine de la cindynique, l'évaluation des risques est l'ensemble des méthodes consistant à calculer la criticité (pertinence et gravité) des dangers. 
Elle vise outre à les quantifier, à qualifier les dangers (qui doivent donc préalablement avoir été identifiés). Elle se base sur « …l’utilisation de faits scientifiques pour définir les effets sur la santé d'une exposition d'individus ou de populations à des matériaux ou à des situations dangereuses ».
Dans ce domaine, on se restreint à l'étude du risque aryétique, c'est-à-dire en ne considérant que les événements à conséquences négatives.
Dans la mesure du possible on s'attache à obtenir des indices de risque (ou quotient de risque) traduits en valeurs chiffrées, pour classer en les hiérarchisant les risques afin de pouvoir prioriser les mesures à prendre pour réduire les risques et/ou atténuer leurs conséquences ou rendre le risque acceptable. On parle d'évaluation chiffrée du risque, ou en anglais quantitative risk assesment (QRA).
La criticité est cette valeur chiffrée, souvent décomposée en plusieurs paramètres :

fréquence ;
effectif exposé ;
gravité ;
niveau de maîtrise ;la criticité est alors le produit des valeurs de ces paramètres.
Le "quotient de danger" (parfois aussi dénommé ratio de danger ; indice de danger ; indice de risque ; quotient de risque) désigne le ratio entre le niveau d’exposition et la valeur toxicologique de référence.

Trouvé est un nom de famille  notamment porté par :

