Cet article fait la liste des accidents mortels de pilotes automobiles de Formule 1. 
Sont pris en compte les décès :

lors d'une épreuve comptant pour le championnat du monde des conducteurs créé en 1950 (qui inclut les 500 miles d'Indianapolis de 1950 à 1960) ;
lors d'épreuves de Formule 1 disputées hors championnat du monde ;
lors de séances d'essais de Formule 1 officielles ou privées ;
lors de séances de qualification de Formule 1 ;
survenus hors circuit (à l'hôpital ou après une période de coma) mais directement imputables à un accident en Formule 1.Au total, quarante-quatre pilotes ont perdu la vie. Vingt-quatre pendant un week-end de Formule 1 (dix-sept en course, huit pendant les essais ou qualification), huit pendant les 500 miles d'Indianapolis, neuf en essais privés et trois pendant une course de Formule 1 ne comptant pas pour le championnat du monde.
Quinze pilotes sont morts dans les années 1950, douze dans les années 1960, dix dans les années 1970, quatre dans les années 1980, deux dans les années 1990 et un dans les années 2010. Les pilotes originaires des États-Unis d'Amérique ont eu le plus grand nombre d'accidents mortels avec onze pilotes disparus.

La perpétuité incompressible est, en France, une peine de réclusion criminelle à perpétuité assortie d'une période de sûreté illimitée empêchant tout aménagement de peine. La loi prévoit toutefois qu'après 30 ans d'incarcération, un tribunal de l'application des peines peut mettre fin à cette période de sûreté perpétuelle. Un aménagement est donc possible in fine, mais en deux étapes.
Cette peine n'est applicable qu'aux crimes suivants : 

meurtre avec viol, tortures ou acte de barbarie d'un mineur de quinze ans ;
meurtre en bande organisée d'une personne dépositaire de l'autorité publique (policier, magistrat, etc.) et ce, à l'occasion ou en raison de ses fonctions ;
assassinat d'une personne dépositaire de l'autorité publique (policier, magistrat, etc.) et ce, à l'occasion ou en raison de ses fonctions ;
crime terroriste.Pour tous les autres crimes, le maximum de la période de sûreté est de vingt-deux ans.
Elle a été instaurée par la loi 94-89 du 1er février 1994 à l’initiative du ministre de la justice de l’époque Pierre Méhaignerie, membre du gouvernement Balladur.
Depuis sa création, seulement quatre personnes y ont été condamnées, parmi lesquelles une a eu sa peine réduite en appel.

Les États-Unis disposent de plusieurs territoires situés dans les Antilles et l'océan Pacifique. Ces territoires sont des entités géographiques et politiques qui ne dépendent d'aucun des cinquante États.
Ces territoires peuvent être répartis en quatre catégories :

les territoires incorporés et organisés (plus aucun n'existe aujourd'hui, mais ce fut le cas d'Hawaï et de l'Alaska, jusqu'en 1959, date de leur élévation au rang d'État) ;
les territoires non incorporés et organisés (Guam, Porto Rico, les îles Mariannes du Nord et les îles Vierges des États-Unis) ;
les territoires non incorporés et non organisés (les Samoa américaines ainsi que huit des neuf îles mineures éloignées des États-Unis — l'exception étant l'atoll Palmyra) ;
les territoires incorporés et non organisés (il n'en existe qu'un seul : l'atoll Palmyra).Ces territoires ont une population totale de 4 millions d'habitants en 2016 pour une superficie totale de 10 456 km2.

On trouvera ci-dessous une liste de découvertes, d'inventions et d'innovations faites par accident, à la suite d'un concours imprévu de circonstances ou par hasard – ce qu'il est devenu courant d'appeler, sous l'influence du livre de Royston Roberts, Serendipity: Accidental Discoveries,  les découvertes et inventions faites par sérendipité.
Elle regroupe sous ce concept des découvertes et des inventions aussi différentes que l'invention accidentelle de l'hélice de bateau — à la suite d'un vrai accident — mais aussi la découverte de la pénicilline par Alexander Fleming (dont il a su exploiter les propriétés thérapeutiques) ou bien encore la découverte par le plus grand des hasards de la grotte de Lascaux ou des manuscrits de la mer Morte.
La sérendipité apparaît alors souvent, tout simplement, comme une manière irrationnelle de faire des découvertes, des inventions et des innovations :  

par accident ;
par un concours de circonstances ;
par erreur ;
par hasard pur ;
par inadvertance ;
par maladresse ;
par mégarde ;
par négligence professionnelle.L'impact économique, social et culturel de ces découvertes, inventions et innovations faites par accident ou par hasard n'a aucun rapport avec leur notoriété médiatique, comme entre l'hélice de bateau de Pettit qui a révolutionné la navigation et le Post-it, toujours cité.[réf. nécessaire]

Une inondation  est une submersion temporaire, naturelle ou artificielle, d'un espace par de l'eau liquide. Ce terme est fréquemment utilisé pour décrire :

le débordement d'un cours d'eau, en crue puis en décrue, sur les terrains voisins ; l'eau est répandue dans les talwegs et les dépressions topographiques ;
le ruissellement très important, soit sur des terres cultivées (inondation boueuse), soit en zone imperméable urbanisée ;
le débordement ou les conséquences de la rupture d'ouvrages artificiels hydrauliques tels que retenues d'eau, digues, canalisations (agricoles, d'eau potable, d'assainissement) ou la rupture d'une retenue naturelle comme celle d'un lac glaciaire, provoquant une inondation soudaine ;
la remontée émergente d'une nappe phréatique ;
l'envahissement temporaire par la mer d'une zone côtière lors d'une submersion marine.L'inondation est un des principaux risques naturels dans le monde ; c'est la catastrophe naturelle causant le plus de dégât. Pour la période 1996-2005, environ 80 % des catastrophes naturelles mondiales étaient d'origine météorologique ou hydrologique. Les inondations auraient affecté en moyenne 66 millions de personnes par an entre 1973 et 1997[réf. nécessaire] et elles devraient s'aggraver dans beaucoup de ports et communes littorales, :  selon une étude évaluant le coût probable de l'élévation des océans et des phénomènes météorologiques extrêmes pour les 136 principales métropoles littorales, les inondations pourraient coûter environ 1 000 milliards par an de 2010 à 2050, rien que pour ces villes.
Les sciences qui étudient les inondations sont l'hydrologie de surface et la cindynique.

