Sissi est une série cinématographique écrite et réalisée par Ernst Marischka entre 1955 et 1957. Elle raconte l'histoire d'amour de l'impératrice Sissi et de l'empereur François-Joseph. Les rôles principaux, Sissi et François-Joseph, sont respectivement joués par les acteurs Romy Schneider et Karlheinz Böhm.

Sissi (1955) ;
Sissi impératrice (1956) ;
Sissi face à son destin (1957) ;Bien qu'il décrive une dynastie différente, le film Les Jeunes Années d'une reine fait souvent figure de prélude à la série de films, qui reprendra le même style, les mêmes décors, le même réalisateur, et les mêmes acteurs dans des rôles presque semblables.

Bourevestnik (russe : Буревестник, « pétrel » en français) peut faire référence à :

Bourevestnik, un sous-marin de la marine impériale russe, lancé en 1916 et mis à la casse par les Français à Bizerte vers 1930 ;
Burevestnik 9M730, un missile de croisière russe expérimental à propulsion et armement nucléaire ;
Base aérienne Bourevestnik (en), base aérienne russe et ancienne base aérienne japonaise sur Iturup, une des îles Kouriles.Le nom de différents clubs de sport de pays de l'ancienne URSS dont :

Burevestnik, ancienne union des sociétés sportives étudiantes et enseignantes de la plupart des grandes écoles et universités de l'URSS ;
Burevestnik Chisinau, aujourd'hui FC Zimbru Chișinău, club de football moldave ;
Burevestnik Tbilissi, club de handball géorgien ;
Burevestnik Frunze, club de football kirghize.
